tables.table_schema:
CREATE TABLE player_interactions (
  player_id INT,
  interaction_type VARCHAR,
  interaction_time TIMESTAMP,
  interaction_details TEXT
);

CREATE TABLE moderators (
    moderator_id INT PRIMARY KEY,
    moderator_name VARCHAR(50),
    moderator_role VARCHAR(20),
    moderator_since DATE
);

CREATE TABLE warnings (
    warning_id INT PRIMARY KEY,
    player_id INT,
    warning_date DATE,
    warning_reason TEXT
);
